/*
    Rutas de la aplicación
*/

import Home from '../../home/Home'
import AboutMe from '../../about-me/AboutMe'
import Technologies from '../../technologies/Technologies'

const routes = [
    {
        path: '/',
        component: Home
    },
    {
        path: '/about-me',
        component: AboutMe
    },
    {
        path: '/technologies',
        component: Technologies
    }
]

export default routes
